L = 10;
Zguess = 1;

h = makeGrid(N, L, 3, 1e-5);
x = cumsum(h);

Tinf = (gamma1 - 1)* q_inf / Gamma_inf;
T0 = Tinf / (1 + lambdan / (lambdaT * zeta1));
cg = (zeta1*cT - cn) / (1 + zeta1 * lambdaT/lambdan);

D   = @(z) D0 + D1*tanh(z) + D2 * (tanh(z)).^2;
